import { En_Hero } from "../comps/Portal";
import { fleet } from "../constants";

const Fleet = () => {
  return (
    <>
      <En_Hero prod={fleet} title="Fleet and Business" get="" contact />
      <section
        className="h-screen"
        style={{ backgroundImage: "url(" + Background + ")" }}
      ></section>
    </>
  );
};

export default Fleet;
